function showFuncErrorTable($functions)
{
    global $builtins;
    echo '<hr />';
    echo '<a name="funcprob"><h2>Problems with Functions</h2></a>'."\n";
    echo '<table border="1">'."\n".'<tr><th>Name</th><th>Defined</th><th>Referenced</th><th>Info</th></tr>';
    foreach ($functions as $name => $value)
    {
	if(array_key_exists($name, $builtins)){ continue;} // skip anything builtin
	// skip anything without an error condition:
	if(! (isset($value[0]) && count($value[1]) <= 1) && ! (count($value[1]) >= 1 && ! isset($value[0]))) { continue;}
        echo "<tr>\n";
	echo "<td>" . htmlentities($name) . "</td>\n";
	if(isset($value[0])){ $defCount = count($value[0]);} else { $defCount = 0;}
	$refCount = count($value[1]) - $defCount; // ref also counts definitions, so subtract them
	echo "<td>".$defCount."</td>\n";
	echo "<td>".$refCount."</td>\n";
	echo "<td>";
	if(isset($value[0]) && count($value[1]) <= 1)
	{
	    echo "<strong>Defined but not referenced!</strong>";
	    foreach($value[0] as $val)
	    {
		echo "<br />".$val[0]." L ".$val[1];
	    }
	}
	else if(count($value[1]) >= 1 && ! isset($value[0]))
	{
	    echo "<strong>Referenced but not defined!</strong>";
	    foreach($value[1] as $val)
	    {
		echo "<br />".$val[0]." L ".$val[1];
	    }
	}
	echo "&nbsp;</td>\n";
	echo "</tr>\n";
    }
    print "</table>";
}

