function getGobals($path)
{
    // finds all global variables declared (not in comments) in all php files in a path
    $myglobals = array();

    $cmd = 'grep -Rn "global " '.$path."/*.php";
    $output = shell_exec($cmd);
    $lines = explode("\n", $output);
    $inComment = false; // tell if we're in a multiline comment
    foreach($lines as $line)
    {
	$file = substr($line, 0, strpos($line, ":"));
	$lineNum = substr($line, strpos($line, ":")+1);
	$line = trim(substr($lineNum, strpos($lineNum, ":")+1)); // make $line the program source line
	$lineNum = (int)substr($lineNum, 0, strpos($lineNum, ":"));
	// ignore anything that's a comment
	if($line == "/*"){ $inComment = true; continue;} // begin a multiline comment
	if($line == "*/"){ $inComment = false;} // end a multiline comment
	if($inComment){ continue;} // inside a multiline comment
	if(substr($line, 0, 2) == "//" || substr($line, 0, 1) == "#"){continue;} // a comment
	// parse the variable name (between $ and ; or ,)
	$matches = array();
	preg_match_all('/\$[a-zA-Z0-9]+/', $line, $matches);
	echo "File: ".$file."\t".$lineNum."\t=".$line."\n";
	if(count($matches[0]) > 0)
	{
	    foreach($matches[0] as $varname)
	    {
		$varname = trim($varname, "$");
		if(! array_key_exists($varname, $myglobals))
		{
		    $myglobals[$varname] = array();
		}
		$myglobals[$varname][] = array("file" => getRealtivePath($path, $file), "line" => $lineNum);
	    }
	}
    }
    return $myglobals;
}

function getFuncs($path)
{
    $functions = array();
    define_dir($path, $functions);
    reference_dir($path, $functions);
    return $functions;
}

function define_dir($path, &$functions) {
    if ($dir = opendir($path)) {
	while (($file = readdir($dir)) !== false) {
	    if (substr($file, 0, 1) == ".") continue;
	    if (is_dir($path . "/" . $file)) {
		define_dir($path . "/" . $file, $functions);
	    } else {
		if (substr($file, - 4, 4) != ".php") continue;
		define_file($path . "/" . $file, $functions);
	    }
	}
    }               
}
function define_file($path, &$functions)
{
    $tokens = token_get_all(file_get_contents($path));
    for ($i = 0; $i < count($tokens); $i++) {
	$token = $tokens[$i];
	if (is_array($token)) {
	    if ($token[0] != T_FUNCTION) continue;
	    $i++;
	    $token = $tokens[$i];
	    if ($token[0] != T_WHITESPACE) die("T_WHITESPACE");
	    $i++;
	    $token = $tokens[$i];
	    if ($token[0] != T_STRING) die("T_STRING");
	    //echo var_dump($token);
	    $functions[$token[1]][0][] = array($path, $token[2]);
	    //echo var_dump($token[1]);
	}
    }
}
function reference_dir($path, &$functions) {
    if ($dir = opendir($path)) {
	while (($file = readdir($dir)) !== false) {
	    if (substr($file, 0, 1) == ".") continue;
	    if (is_dir($path . "/" . $file)) {
		reference_dir($path . "/" . $file, $functions);
	    } else {
		if (substr($file, - 4, 4) != ".php") continue;
		reference_file($path . "/" . $file, $functions);
	    }
	}
    }               
}
function reference_file($path, &$functions) {
    $tokens = token_get_all(file_get_contents($path));
    for ($i = 0; $i < count($tokens); $i++) {
	$token = $tokens[$i];
	if (is_array($token)) {
	    if ($token[0] != T_STRING) continue;
	    if ($tokens[$i + 1] != "(") continue;
	    $functions[$token[1]][1][] = array($path, $token[2]);
	}
    }
}

function getRealtivePath($path, $file)
{
    // takes an absolute path and a filename that should have an absolute path
    // returns the path to the file relative to the give top-level absolute $path
    $temp = str_replace($path, "", $file);
    if(substr($temp, 0, 1) == "/"){ $temp = substr($temp, 1);}
    return $temp;
}

